import React from "react"
import { Link, useNavigate } from "react-router-dom"

export const NavBar = () => {

  const navigate = useNavigate()

  return (
    <nav className="border-b border-gray-900/10 flex ml-3 p-4 border-">
      <ul className="flex flex-1 gap-11 pl-11">
        <li></li>
        <Link className="hover:bg-gray-300 p-2 rounded" to="/">Home</Link>
        <li></li>
        <Link className="hover:bg-gray-300 p-2 rounded" to="/students" >Students</Link>
        <Link className="hover:bg-gray-300 p-2 rounded" to="/worksheets">Worksheets</Link>
        <Link className="hover:bg-gray-300 p-2 rounded" to="/worksheets/create">New Worksheet</Link>
      </ul>
      <ul className="pr-11">
        {localStorage.getItem("capstone_user") ? (
          <li className="hover:bg-gray-300 p-2 rounded" onClick={() => {
            localStorage.removeItem("capstone_user")
            navigate("/", { replace: true })
          }}>Logout</li>) : ("")
        }
      </ul>
    </nav>
  )
}
